import React, { Component } from "react";

class Like extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log("Like Rendered");
    return (
      <div>
        <i
          className={"fa fa-heart" + (this.props.liked ? "" : "-o")}
          aria-hidden="true"
          onClick={this.props.onClick}
        ></i>
      </div>
    );
  }
}

export default Like;
